"""###9-	Check the outliers and their authenticity."""

import matplotlib.pyplot as plt
import seaborn as sns

plt.figure(figsize=(15, 10))
for i, col in enumerate(numeric_cols):
    plt.subplot(5, 4, i+1)
    sns.boxplot(y=data[col])
    plt.title(col)
plt.tight_layout()
plt.show()

"""###10-	Do the necessary data cleaning steps like dropping duplicates, unnecessary columns, null value imputation, outliers treatment etc."""

data_cleaned = data.drop_duplicates()
print(f"\nDropped {data.shape[0] - data_cleaned.shape[0]} duplicate rows.")

data_cleaned[numeric_cols] = data_cleaned[numeric_cols].fillna(data_cleaned[numeric_cols].mean())
print("\nHandled null values.")

for col in numeric_cols:
    Q1 = data_cleaned[col].quantile(0.25)
    Q3 = data_cleaned[col].quantile(0.75)
    IQR = Q3 - Q1
    lower_bound = Q1 - 1.5 * IQR
    upper_bound = Q3 + 1.5 * IQR
    data_cleaned[col] = data_cleaned[col].clip(lower_bound, upper_bound)
print("\nOutliers treated.")

print("\nCleaned data summary:")
print(data_cleaned.describe())

"""##1.	Application and Enrollment Analysis

- ###	What is the average number of applications received by colleges?
"""

average_apps = data_cleaned['Apps'].mean()
print(f"Average number of applications received by colleges: {average_apps:.2f}")

"""**Output**

- ### 	What percentage of applications are accepted on average across all colleges?
"""

average_acceptance_rate = (data_cleaned['Accept'].sum() / data_cleaned['Apps'].sum()) * 100
print(f"Average percentage of applications accepted: {average_acceptance_rate:.2f}%")

"""- ### What is the average enrollment rate (number of students enrolled divided by number of applications accepted)?"""

average_enrollment_rate = (data_cleaned['Enroll'].sum() / data_cleaned['Accept'].sum()) * 100
print(f"Average enrollment rate: {average_enrollment_rate:.2f}%")

"""- ### Which college has the highest number of applications received?"""

college_highest_apps = data_cleaned.loc[data_cleaned['Apps'].idxmax()]['Names']
highest_apps = data_cleaned['Apps'].max()
print(f"College with the highest number of applications received: {college_highest_apps} ({highest_apps} applications)")

